import React, { useState, useEffect } from 'react'
import { blogDataFetch } from './microCmsFetch'

function App() {
  const [blogs, setBlogs] = useState([])
  useEffect(() => {
    blogDataFetch(setBlogs)
  },[])

  return (
    <div>
      {blogs.map(blog => (
        <div key={blog.id}>
          <img src={blog.image.url} />
          <h2>{blog.title}</h2>
          <div dangerouslySetInnerHTML={{ __html: blog.body }} />
        </div>
      ))}
    </div>
  );
}

export default App;
